import React from 'react';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import { 
  Users, 
  Target, 
  Cpu, 
  Compass, 
  ArrowRight,
  ShieldCheck
} from 'lucide-react';

const Services = () => {
  const [ref, inView] = useInView({
    triggerOnce: true,
    threshold: 0.1,
  });

  const coachingServices = [
    {
      title: "Mindset Architecture",
      subtitle: "Personal Coaching",
      icon: Cpu,
      description: "Using informatics principles to 'debug' limiting beliefs and rewrite your internal operating system for success.",
      features: ["1-on-1 Deep Dive Sessions", "Cognitive Reframing", "Habit Loop Engineering"],
      accent: "from-orange-500 to-orange-300"
    },
    {
      title: "Career Evolution",
      subtitle: "Strategic Growth",
      icon: Target,
      description: "For professionals in tech and data. Learn to lead with emotional intelligence without losing your logical edge.",
      features: ["Leadership Presence", "Technical Career Roadmap", "Burnout Prevention"],
      accent: "from-blue-500 to-cyan-400"
    },
    {
      title: "Informatics Mentorship",
      subtitle: "Educational Consulting",
      icon: Compass,
      description: "Customized instruction for students and teams looking to master Data Engineering and System Design.",
      features: ["Data Workflow Optimization", "System Architecture", "Academic Guidance"],
      accent: "from-emerald-500 to-teal-400"
    }
  ];

  return (
    <section id="services" className="py-24 bg-[#080808] relative">
      <div className="container mx-auto px-4 md:px-8">

        <motion.div
          ref={ref}
          className="text-center mb-20"
          initial={{ opacity: 0, y: 30 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8 }}
        >
          <span className="text-orange-500 font-bold uppercase tracking-[0.3em] text-xs mb-4 block">Tailored Transformation</span>
          <h2 className="text-4xl md:text-6xl font-serif font-bold text-white mb-6">Ways We Can <span className="text-orange-500 italic">Work Together</span></h2>
          <p className="text-gray-400 max-w-2xl mx-auto text-lg font-light leading-relaxed">
            Whether you are looking for personal mindset shifts or professional 
            systems optimization, I offer structured paths to help you evolve.
          </p>
        </motion.div>

        <div className="grid grid-cols-1 lg:grid-cols-3 gap-8">
          {coachingServices.map((service, index) => (
            <motion.div
              key={index}
              className="group relative p-8 rounded-[40px] bg-white/[0.02] border border-white/5 hover:border-white/20 transition-all duration-500 flex flex-col h-full overflow-hidden"
              initial={{ opacity: 0, y: 40 }}
              animate={inView ? { opacity: 1, y: 0 } : {}}
              transition={{ delay: index * 0.2, duration: 0.8 }}
              whileHover={{ y: -10 }}
            >
              {/* Background Glow Effect */}
              <div className={`absolute -top-24 -right-24 w-48 h-48 bg-gradient-to-br ${service.accent} opacity-0 group-hover:opacity-10 blur-[60px] transition-opacity duration-500`} />

              <div className="mb-8">
                <div className={`w-14 h-14 rounded-2xl bg-gradient-to-br ${service.accent} flex items-center justify-center text-black mb-6 shadow-lg shadow-orange-500/10`}>
                  <service.icon size={28} />
                </div>
                <span className="text-xs font-black uppercase tracking-widest text-gray-500 block mb-2">{service.subtitle}</span>
                <h3 className="text-2xl font-bold text-white mb-4 leading-tight">{service.title}</h3>
                <p className="text-gray-400 text-sm font-light leading-relaxed">
                  {service.description}
                </p>
              </div>

              <ul className="space-y-4 mb-10 flex-grow">
                {service.features.map((feature, fIndex) => (
                  <li key={fIndex} className="flex items-center gap-3 text-sm text-gray-300">
                    <ShieldCheck size={16} className="text-orange-500" />
                    {feature}
                  </li>
                ))}
              </ul>

              <motion.button
                onClick={() => document.getElementById('contact').scrollIntoView({ behavior: 'smooth' })}
                className="group/btn flex items-center justify-center gap-3 w-full py-4 rounded-2xl border border-white/10 hover:bg-white text-white hover:text-black transition-all font-bold text-xs uppercase tracking-widest"
              >
                Learn More
                <ArrowRight size={16} className="group-hover/btn:translate-x-1 transition-transform" />
              </motion.button>
            </motion.div>
          ))}
        </div>

        {/* Custom Solution Callout */}
        <motion.div
          className="mt-20 p-1 bg-gradient-to-r from-orange-500/20 via-blue-500/20 to-emerald-500/20 rounded-[40px]"
          initial={{ opacity: 0, scale: 0.95 }}
          animate={inView ? { opacity: 1, scale: 1 } : {}}
          transition={{ delay: 0.6 }}
        >
          <div className="bg-[#0c0c0c] rounded-[38px] p-8 md:p-12 flex flex-col md:flex-row items-center justify-between gap-8 text-center md:text-left">
            <div>
              <h4 className="text-2xl font-bold text-white mb-2">Need a Bespoke Solution?</h4>
              <p className="text-gray-400 font-light">Custom workshops for corporations or universities looking for the intersection of Tech & Wellness.</p>
            </div>
            <button 
              onClick={() => document.getElementById('contact').scrollIntoView({ behavior: 'smooth' })}
              className="px-10 py-4 bg-orange-500 text-white rounded-2xl font-bold hover:bg-orange-600 transition-all whitespace-nowrap"
            >
              Inquire Now
            </button>
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default Services;
